import React, { useState, useEffect } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import Container from "@material-ui/core/Container";
import { useHistory } from "react-router-dom";
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';




const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(8),
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: "100%", // Fix IE 11 issue.
    marginTop: theme.spacing(3),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
}));


export default function UserCreate() {
  const classes = useStyles();
  

  const [nomeAtividade, setnomeAtividade] = useState("");
  const [duracaoAtividade, setduracaoAtividade] = useState("");
  const [tipoAtividade, settipoAtividade] = useState("");

 

 


  const history = useHistory();
  const handleCreateUser = () => {
    fetch(`https://r4wj0utagf.execute-api.us-east-1.amazonaws.com/prod/createuser?varFirstName=${firstname}&varLastName=${lastname}&varEmail=${email}&varUserName=${username}&varCpfCnpj=${cpfCnpj}&varDate=${date}`, {
      method: 'GET'
    })
      .then((res) => {
        if (res.status === 200) {
          
          history.push("/");
        } else {
          window.alert("Convem atualizar a pagina")
          throw new Error(`Failed to Create. Status code: ${res.status}`);
        }
      })
      history.push("/Users");
  };

  function MySelect() {
    const classes = useStyles();
    const [selectedOption, setSelectedOption] = useState('');
  
    const handleChange = (event) => {
      setSelectedOption(event.target.value);
    };
  

 
  return (
    <Container maxWidth="xs">
      <div className={classes.paper}>
        <Typography component="h1" variant="h5">
          User
        </Typography>
        <form className={classes.form} >
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                id="nomeAtividade"
                value={nomeAtividade}
                label="Nome da Atividade"
                onChange={(e) => setnomeAtividade(e.target.value)}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                id="duracaoAtividade"
                value={duracaoAtividade}
                label="Duracão da Atividade"
                onChange={(e) => setduracaoAtividade(e.target.value)}
              />
            </Grid>
            <Grid item xs={12}>
            <FormControl className={classes.formControl}>
              <InputLabel id="demo-simple-select-label">Selecione uma opção</InputLabel>
              <Select
                labelId="demo-simple-select-label"
                id="demo-simple-select"
                value={selectedOption}
                onChange={handleChange}
              >
                <MenuItem value={1}>Opção 1</MenuItem>
                <MenuItem value={2}>Opção 2</MenuItem>
                <MenuItem value={3}>Opção 3</MenuItem>
              </Select>
            </FormControl>
          );
            </Grid>


          </Grid>
          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            className={classes.submit}
            onClick={handleCreateUser}
          >
            Create
          </Button>
        </form>
      </div>
    </Container>
  );
  }
}
